riable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"895064","type":"CustomJS"},{"attributes":{"label":{"value":"Peak (102%)"},"renderers":[{"id":"894754"}]},"id":"894771","type":"LegendItem"},{"attributes":{"source":{"id":"894694"}},"id":"894891","type":"CDSView"},{"attributes":{"line_alpha":0.1,"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.0225728506}},"id":"894822","type":"Line"},{"attributes":{"overlay":{"id":"894870"}},"id":"894865","type":"BoxZoomTool"},{"attributes":{"dimensions":"width"},"id":"894863","type":"PanTool"},{"attributes":{"axis_label":"Profit / Loss","coordinates":null,"formatter":{"id":"894896"},"group":null,"major_label_policy":{"id":"895100"},"minor_tick_line_color":null,"ticker":{"id":"894860"}},"id":"894859","type":"LinearAxis"},{"attributes":{},"id":"894868","type":"ResetTool"},{"attributes":{},"id":"894707","type":"LinearScale"},{"attributes":{},"id":"894867","type":"RedoTool"},{"attributes":{},"id":"894869","type":"SaveTool"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"895006","type":"WheelZoomTool"},{"attributes":{"data":{"Close":{"__ndarray__":"ZmZmZmZmQUBI4XoUrudAQK5H4XoU7kBAexSuR+E6QUAfhetRuB5BQArXo3A9akFAKVyPwvUIQUBcj8L1KDxBQClcj8L1SEFAUrgehetxQUDNzMzMzKxBQJqZmZmZmUFAPQrXo3BdQUDNzMzMzCxBQIXrUbgepUBAZmZmZmamQECuR+F6FI5AQPYoXI/ClUBACtejcD2KQEDXo3A9CndAQHE9CtejEEBAcT0K16NQQEBcj8L1KFxAQArXo3A9ikBAPQrXo3DdQEAzMzMzM/NAQK5H4XoUDkFAuB6F61H4QEB7FK5H4RpBQOxRuB6FS0FA16Nw
